import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';


export default class ProjectList extends Component {
    constructor(props){
        super(props);
        this.state = {
        }
    }

    componentDidMount(){
        axios.get('http://localhost:4000/projects/')
    }

    render() {
        return (
            <div className="d-inline-block primary project-list col-sm-8 col-12">
                <table className="table table-hover table-light secondary rounded position-relative offset-1 col-10">
                <thead>
                    <tr>
                        <th>#</th>
                        <th>Name</th>
                        <th>Tech</th>
                        <th>Link</th>
                    </tr>
                </thead>
                    <tbody>
                    </tbody>
                </table>
            </div>
        );
    }
}
